import React, { useState } from 'react'

function ImageSlider() {

    const imgs = [
        {id: 0, name:"Gill", value: "data:image/jpeg;base64,"},
        {id: 0, name:"Bumrah", value: "data:image/jpeg;base64,"},
        {id: 0, name:"Sanju", value: "data:image/jpeg;base64,"},
        {id: 0, name:"Sachin", value: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQpTrXrJCUC9MWBCfdCnMvZX-DZmqp8PgmLhg&s"}
    ]

    const [sliderData , setSliderData] = useState(imgs[0])

    const handleClick = (index) =>{
        const slider = imgs[index]
        setSliderData(slider)
    }


  return (
    <div>
        <img src={sliderData.value} height="300" width="500" style={{borderRadius: "50px"}}/>
        <div>
      {imgs.map((image,i)=>
    // <img src ={image.value} key={i} onClick={()=>handleClick(i)} height="100" width="100"/>
    <button onClick={()=>handleClick(i)}>{image.name}</button>
    )}
    
    </div>
    </div>
  )
}

export default ImageSlider
